	(121, 'proxy-cloud-service', 'service', 'serverConfig', '{"cloud": {"http": {"host": "http://cloud.fox-tech.cn/prod-api", "lockdown": 60, "password": "12345678", "username": "fox-edge"}, "mode": "mqtt", "mqtt": {"ip": "39.108.137.38", "name": "Mica-Mqtt-Client", "port": 1883, "enabled": true, "timeout": 5, "use-ssl": false, "version": "mqtt_3_1_1", "clientId": "000001", "password": "123456", "reconnect": true, "user-name": "mica", "re-interval": 5000, "clean-session": true, "keep-alive-secs": 60, "buffer-allocator": "heap", "read-buffer-size": "8KB", "max-bytes-in-message": "10MB"}}, "local": {"lockdown": 60, "password": "12345678", "username": "admin"}}', '{"list": [{"saveMode": "Raw", "showMode": "Security", "fieldName": "local.password", "valueType": "string", "defaultValue": ""}, {"saveMode": "Raw", "showMode": "Security", "fieldName": "cloud.http.password", "valueType": "string", "defaultValue": ""}, {"saveMode": "Raw", "showMode": "Security", "fieldName": "cloud.mqtt.password", "valueType": "string", "defaultValue": ""}]}', 'proxy-cloud-service服务所需要的云端配置：  \n\n1. cloud\n跟fox-cloud连接的云端配置\n\nmode：连接模式，参数可以是 mqtt 和 http\nmqtt：mqtt模式下的参数，此时使用MQTT协议，把数据发送到fox-cloud\nhttp： http模式下的参数，此时使用http协议，把数据发送到fox-cloud\n\n1.1 cloud -> http\nhost：云端fox-cloud的API服务器\nusername：fox-cloud上的账号\npassword：fox-cloud上的密码\nlockdown：为了避免登录失败后，反复登录fox-cloud，需要等待一段时间，避免被fox-cloud认为是恶意攻击\n\n1.2 cloud -> mqtt\n连接云端MQTT Broker的MQTT配置\n\nenabled: true   # 是否开启客户端，默认：true\nip: 120.79.69.201  # 连接的服务端 ip ，默认：127.0.0.1\nport: 1883  # 端口：默认：1883\nname: Mica-Mqtt-Client  # 名称，默认：Mica-Mqtt-Client\nclientId: 000001# 客户端Id（非常重要，一般为设备 sn，不可重复）\nuser-name: mica # 认证的用户名\npassword: 123456# 认证的密码\ntimeout: 5  # 超时时间，单位：秒，默认：5秒\nreconnect: true # 是否重连，默认：true\nre-interval: 5000   # 重连时间，默认 5000 毫秒\nversion: mqtt_3_1_1 # mqtt 协议版本，可选 MQTT_3_1、mqtt_3_1_1、mqtt_5，默认：mqtt_3_1_1\nread-buffer-size: 8KB   # 接收数据的 buffer size，默认：8k\nmax-bytes-in-message: 10MB  # 消息解析最大 bytes 长度，默认：10M\nbuffer-allocator: heap  # 堆内存和堆外内存，默认：堆内存\nkeep-alive-secs: 60 # keep-alive 时间，单位：秒\nclean-session: true # mqtt clean session，默认：true\nuse-ssl: false  # 是否启用 ssl，默认：false\n\n\n2. local\n接受云端操作请求的时候，fox-edge的登录账号信息，此时会通过配置信息，会接受云端MQTT代理的操作请求\n\nusername：fox-edge上的账号\npassword：fox-edge上的密码\nlockdown：为了避免登录失败后，反复登录fox-cloud，需要等待一段时间，避免被fox-cloud认为是恶意攻击', 1697605281305, 1701164232031),
	(124, 'cloud-thingsboard-service', 'service', 'serverConfig', '{"mode": "period", "period": {"unit": "minute", "interval": 30}}', '{}', '第三方物联网云平台ThingsBoard的数据推送配置参数：\n\n字段说明\nmode ： 发布模式，可选值period 或者 trigger\ntrigger模式，为数据变更就发送，这种方式非常实时，但是推送的数据量会非常大，ThingsBoard那边不一定顶得住这么大的数据量。\nperiod模式，为定时发送数据方式，单位有second、minute、hour三种单位', 1698485565179, 1698486156925),
