	(141, 'channel-tcp-client', 'service', 'serverConfig', '{"logger": false, "decoderList": [{"jarFile": "/jar/decoder/fox-edge-server-protocol-core.v1.jar"}, {"jarFile": "/jar/decoder/fox-edge-server-protocol-zktl-air6in1.v1.jar"}, {"jarFile": "/jar/decoder/fox-edge-server-protocol-zktl-air5in1.v1.jar"}]}', '{}', 'channel-tcp-listener全局的配置信息：\n\njarFile：解码器所在的文件位置', 1699157588452, 1699157588452),
	(210, 'channel-tcp-server', 'service', 'serverConfig', '{"logger": false, "servers": [{"engine": {"engineType": "Java", "keyHandler": "cn.foxtech.device.protocol.v1.zktl.air6in1.handler.ZktlServiceKeyHandler", "splitHandler": "cn.foxtech.device.protocol.v1.zktl.air6in1.handler.ZktlSplitMessageHandler"}, "serverPort": 9301}, {"engine": {"engineType": "JavaScript", "keyHandler": {"format": "TXT", "deviceType": "消防用水五合一（LoRaWan）", "manufacturer": "武汉中科图灵"}, "splitHandler": {"format": "TXT", "deviceType": "消防用水五合一（LoRaWan）", "manufacturer": "武汉中科图灵"}}, "serverPort": 9302}], "jarFiles": [{"jarFile": "/jar/decoder/fox-edge-server-protocol-zktl-air6in1.v1.jar"}]}', '{}', 'tcp-server通道的配置信息：\n\n\n支持Java和JavaScript两种拆包和身份识别引擎引擎\n\njarFile：解码器所在的文件位置\nsplitHandler：拆包类的完整名称\nkeyHandler：提取设备身份信息的完整名称\n\nJava引擎时，要配置jar文件，并且以字符串的方式，指出类名称。\nJavaScript引擎时候，要配置JSP通道操作方法，并以对象的方式指明厂商和设备类型\nformat，指明的是收到的报文，以TXT格式还是以HEX格式的方式，传递给JavaScript脚本\nTXT，指的是TCP上传输的是一段文本流报文\nHEX，指的是TCP上传输的是一段二进制报文\n', 1699936938827, 1700027233779),
	(214, 'channel-mqtt-client', 'service', 'serverConfig', '{"mqtt": {"host": "39.108.137.38", "name": "Mica-Mqtt-Client", "port": 1883, "enabled": true, "timeout": 5, "use-ssl": false, "version": "mqtt_3_1_1", "clientId": "", "password": "12345678", "reconnect": true, "user-name": "mica", "re-interval": 5000, "clean-session": true, "keep-alive-secs": 60, "buffer-allocator": "heap", "read-buffer-size": "8KB", "max-bytes-in-message": "10MB"}, "topic": "/v1/device/response/#"}', '{"list": [{"saveMode": "Raw", "showMode": "Security", "fieldName": "mqtt.password", "valueType": "string", "defaultValue": ""}]}', 'channel-mqtt-client通道的配置信息：\n\ntopic：指的是订阅topic，这边要通过通配符来指明，接收一批设备\n接收到一批设备消息后，具体对应哪个设备，通过通道服务定义哪个设备对应哪个t具体的opic，即可区分收到的数据，是哪个设备的。\n\nmqtt：这是mqtt的连接厂商，主要是host、port、clientId、账号、密码这几个参数\nclientId：如果没有填写唯一性ID，那么就会随机生成一个ID', 1700048318059, 1700049270288),
	(220, 'iot-whzktl', 'service', 'serverConfig', '{"extend": {"extendField": "whzktl"}, "remote": {"http": {"host": ""}, "mode": "mqtt", "mqtt": {"host": "39.108.137.38", "name": "Mica-Mqtt-Client", "port": 1883, "enabled": true, "timeout": 5, "use-ssl": false, "version": "mqtt_3_1_1", "clientId": "whzktl_001", "password": "123456", "reconnect": true, "user-name": "mica", "re-interval": 5000, "clean-session": true, "keep-alive-secs": 60, "buffer-allocator": "heap", "read-buffer-size": "8KB", "max-bytes-in-message": "10MB"}}, "whzktl": {"publish": "/zktl/gateway/{edgeId}/up", "subscribe": "/zktl/gateway/{edgeId}/down/#"}}', '{"list": [{"saveMode": "Raw", "showMode": "Security", "fieldName": "cloud.mqtt.password", "valueType": "string", "defaultValue": ""}]}', 'iot-huawei服务所需要的云端配置：  \n\n1. cloud\n跟fox-cloud连接的云端配置\n\nmode：连接模式，参数可以是 mqtt 和 http\nmqtt：mqtt模式下的参数，此时使用MQTT协议，把数据发送到fox-cloud\nhttp： http模式下的参数，此时使用http协议，把数据发送到fox-cloud\n\n1.1 cloud -> http\nhost：云端fox-cloud的API服务器\nusername：fox-cloud上的账号\npassword：fox-cloud上的密码\nlockdown：为了避免登录失败后，反复登录fox-cloud，需要等待一段时间，避免被fox-cloud认为是恶意攻击\n\n1.2 cloud -> mqtt\n连接云端MQTT Broker的MQTT配置\n\nenabled: true   # 是否开启客户端，默认：true\nip: 120.79.69.201  # 连接的服务端 ip ，默认：127.0.0.1\nport: 1883  # 端口：默认：1883\nname: Mica-Mqtt-Client  # 名称，默认：Mica-Mqtt-Client\nclientId: 000001# 客户端Id（非常重要，一般为设备 sn，不可重复）\nuser-name: mica # 认证的用户名\npassword: 123456# 认证的密码\ntimeout: 5  # 超时时间，单位：秒，默认：5秒\nreconnect: true # 是否重连，默认：true\nre-interval: 5000   # 重连时间，默认 5000 毫秒\nversion: mqtt_3_1_1 # mqtt 协议版本，可选 MQTT_3_1、mqtt_3_1_1、mqtt_5，默认：mqtt_3_1_1\nread-buffer-size: 8KB   # 接收数据的 buffer size，默认：8k\nmax-bytes-in-message: 10MB  # 消息解析最大 bytes 长度，默认：10M\nbuffer-allocator: heap  # 堆内存和堆外内存，默认：堆内存\nkeep-alive-secs: 60 # keep-alive 时间，单位：秒\nclean-session: true # mqtt clean session，默认：true\nuse-ssl: false  # 是否启用 ssl，默认：false\n\n\n2. local\n接受云端操作请求的时候，fox-edge的登录账号信息，此时会通过配置信息，会接受云端MQTT代理的操作请求\n\nusername：fox-edge上的账号\npassword：fox-edge上的密码\nlockdown：为了避免登录失败后，反复登录f