	(1036, '设备告警', '消防用水五合一（LoRaWan）', '武汉中科图灵科技有限公司', 'JavaScript', 'device', '{"decode": {"code": "/**\\n* 编码器的入口函数\\n* 全局参数：\\n*     fox_edge_data：json string格式 或者 hex string格式的接收数据\\n*     fox_edge_param：json string格式的设备参数的合并对象\\n* 返回值：\\n*   提供给通道的发送数据。根据不同的通道服务，它可能是HEX结构的文本，也可能是JSON结构的对象，请自行根据选定的通道服务进行确认\\n*/\\nfunction decode() {\\n  var object = marge(fox_edge_data);\\n\\treturn JSON.stringify(object);\\n}\\n\\n/**\\n * 消防用水五合一\\n * @param message\\n */\\nfunction marge(message) {\\n\\n\\tif (message.substring(0, 4) == \'2424\') {\\n\\n\\t\\treturn analysis(message);\\n\\t} else {\\n\\t\\t//LoRaWan设备数据接入到了iot.ink上\\n\\t\\tvar json = JSON.parse(message);\\n\\n\\t\\tvar data = json[\'data\'];\\n\\n\\t\\t//需要处理的16进制字符串\\n\\t\\tvar validMessage = data[\'data\'];\\n\\n\\t\\treturn analysis(validMessage);\\n\\t}\\n\\n}\\n\\n/**\\n * 解析数据\\n * @param message\\n */\\nfunction analysis(message) {\\n\\n\\tvar points;\\n\\tvar iccid = \'\';\\n\\tvar status = 2;\\n\\t//是否是指令下发的返回数据\\n\\tvar flag = false;\\n\\t//是否用消防平台的自身离线周期\\n\\tvar offlineFlag = true;\\n\\n\\t//防拆\\n\\tvar fx = message.substring(8, 9);\\n\\t//外部触发状态\\n\\tvar wbc = message.substring(9, 10);\\n\\t//外部开关2\\n\\tvar wbk2 = message.substring(10, 11);\\n\\t//外部开关1\\n\\tvar wbk1 = message.substring(11, 12);\\n\\t//包类型\\n\\tvar blx = message.substring(12, 13);\\n\\t//电池电压\\n\\tvar vol = parseInt(message.substring(13, 17), 16) * 0.001;\\n\\tvol = vol.toFixed(2);\\n\\t//采集数据\\n\\t//2424033886859105813621889861120240012109563001110e4f0006070700aa\\n\\tvar value = parseInt(message.substring(17, 21), 16) * 0.001;\\n\\tvalue = value.toFixed(2);\\n\\tif (value &gt; 60) {\\n\\t\\tvalue = 0;\\n\\t}\\n\\t//24242315101100E5A0000000300A0A  液位0\\n\\t//信号强度\\n\\tvar sign = parseInt(message.substring(29, 31), 16);\\n\\n\\t//防拆测点\\n\\t//var XFC_point = xfcMessage(fx);\\n\\t// if (XFC_point.alarmStatus == 1) {\\n\\t//   status = 1;\\n\\t// }\\n\\t//电压\\n\\tvar VOL_point = {\\n\\t\\t\\"alarmType\\": \'正常\',\\n\\t\\t\\"alarmStatus\\": 2,\\n\\t\\t\\"alarmValue\\": vol\\n\\t};\\n\\t//采集数据\\n\\tvar VALUE_point = {\\n\\t\\t\\"alarmType\\": \'正常\',\\n\\t\\t\\"alarmStatus\\": 2,\\n\\t\\t\\"alarmValue\\": value\\n\\t};\\n\\t//信号强度\\n\\tvar SIGN_point = {\\n\\t\\t\\"alarmType\\": \'正常\',\\n\\t\\t\\"alarmStatus\\": 2,\\n\\t\\t\\"alarmValue\\": sign\\n\\t};\\n\\n\\tvar OFFLINE = {\\n\\t\\t\\"alarmType\\": \'正常\',\\n\\t\\t\\"alarmStatus\\": 2,\\n\\t\\t\\"alarmValue\\": 2\\n\\t}\\n\\n\\t//设备类型3.’1’表示消火栓，’2’表示水压，’3’表示水位，’4’表示门磁，’5’表示水浸；\\n\\tvar deviceType = message.substring(5, 6);\\n\\tif (deviceType == \'4\') {\\n\\n\\t\\tif (wbc == \'1\') {\\n\\t\\t\\tvar MENCI_1 = {\\n\\t\\t\\t\\t\\"alarmType\\": \'正常\',\\n\\t\\t\\t\\t\\"alarmStatus\\": 2,\\n\\t\\t\\t\\t\\"alarmValue\\": 2\\n\\t\\t\\t};\\n\\t\\t\\tstatus = 2;\\n\\t\\t\\tpoints = {\\n\\t\\t\\t\\t\\"OFFLINE\\": OFFLINE,\\n\\t\\t\\t\\t\\"VOL\\": VOL_point,\\n\\t\\t\\t\\t\\"SIGN\\": SIGN_point,\\n\\t\\t\\t\\t\\"MENCI_1\\": MENCI_1,\\n\\t\\t\\t\\t\\"MENCI_2\\": MENCI_1,\\n\\t\\t\\t\\t\\"status\\": status\\n\\t\\t\\t};\\n\\t\\t} else {\\n\\t\\t\\tvar MENCI_1 = menci(wbk1);\\n\\t\\t\\tvar MENCI_2 = menci(wbk2);\\n\\n\\t\\t\\tif (MENCI_1[\'alarmStatus\'] == 1 || MENCI_2[\'alarmStatus\'] == 1) {\\n\\t\\t\\t\\tstatus = 1;\\n\\t\\t\\t} else {\\n\\t\\t\\t\\tstatus = 2;\\n\\t\\t\\t}\\n\\n\\t\\t\\tpoints = {\\n\\t\\t\\t\\t\\"OFFLINE\\": OFFLINE,\\n\\t\\t\\t\\t\\"VOL\\": VOL_point,\\n\\t\\t\\t\\t\\"SIGN\\": SIGN_point,\\n\\t\\t\\t\\t\\"MENCI_1\\": MENCI_1,\\n\\t\\t\\t\\t\\"MENCI_2\\": MENCI_2,\\n\\t\\t\\t\\t\\"status\\": status\\n\\t\\t\\t};\\n\\n\\t\\t}\\n\\n\\t} else if (deviceType == \'5\') {\\n\\t\\tif (wbc == \'1\') { //1外部触发 2,0设备触发\\n\\t\\t\\tstatus = 2;\\n\\t\\t\\tpoints = {\\n\\t\\t\\t\\t\\"OFFLINE\\": OFFLINE,\\n\\t\\t\\t\\t\\"VOL\\": VOL_point,\\n\\t\\t\\t\\t\\"WF\\": {\\n\\t\\t\\t\\t\\t\\"alarmType\\": \'正常\',\\n\\t\\t\\t\\t\\t\\"alarmStatus\\": 2,\\n\\t\\t\\t\\t\\t\\"alarmValue\\": 2\\n\\t\\t\\t\\t},\\n\\t\\t\\t\\t\\"SIGN\\": SIGN_point,\\n\\t\\t\\t\\t\\"status\\": status\\n\\t\\t\\t};\\n\\t\\t} else {\\n\\t\\t\\tvar wf = shuijing(wbk1);\\n\\t\\t\\tif (wf[\'alarmStatus\'] == 1) {\\n\\t\\t\\t\\tstatus = 1;\\n\\t\\t\\t} else {\\n\\t\\t\\t\\tstatus = 2;\\n\\t\\t\\t}\\n\\t\\t\\tpoints = {\\n\\t\\t\\t\\t\\"OFFLINE\\": OFFLINE,\\n\\t\\t\\t\\t\\"VOL\\": VOL_point,\\n\\t\\t\\t\\t\\"WF\\": wf,\\n\\t\\t\\t\\t\\"SIGN\\": SIGN_point,\\n\\t\\t\\t\\t\\"status\\": status\\n\\t\\t\\t};\\n\\t\\t}\\n\\n\\t} else if (deviceType == \'2\' || deviceType == \'3\') {\\n\\n\\t\\tstatus = 2;\\n\\t\\tpoints = {\\n\\t\\t\\t\\"OFFLINE\\": OFFLINE,\\n\\t\\t\\t\\"VOL\\": VOL_point,\\n\\t\\t\\t\\"VALUE\\": VALUE_point,\\n\\t\\t\\t\\"SIGN\\": SIGN_point,\\n\\t\\t\\t\\"status\\": status\\n\\t\\t};\\n\\t} else {\\n\\t\\tpoints = {\\n\\t\\t\\t\\"OFFLINE\\": OFFLINE,\\n\\t\\t\\t\\"VOL\\": VOL_point,\\n\\t\\t\\t\\"VALUE\\": VALUE_point,\\n\\t\\t\\t\\"SIGN\\": SIGN_point,\\n\\t\\t\\t\\"status\\": status\\n\\t\\t};\\n\\t}\\n\\n\\t//redis中存储的离线时间数据\\n\\tvar baseJson = {\\n\\t\\t\\"isalarm\\": false,\\n\\t\\t\\"isguzhang\\": false\\n\\t};\\n\\t//将离线周期数据和测点总数据封装成一个对象 返回   flag ：是否是指令下发返回的响应数据\\n\\tvar obj = {\\n\\t\\t\\"offlineData\\": baseJson,\\n\\t\\t\\"points\\": points,\\n\\t\\t\\"iccid\\": iccid,\\n\\t\\t\\"flag\\": flag,\\n\\t\\t\\"offlineFlag\\": offlineFlag\\n\\t};\\n\\n\\treturn obj;\\n}\\n\\nfunction xfcMessage(fx) {\\n\\tvar fx_alarmType = \'防拆报警解除\';\\n\\tvar fx_alarmStatus = 2;\\n\\tif (fx == \'1\') {\\n\\t\\tfx_alarmType = \'防拆报警\';\\n\\t\\tfx_alarmStatus = 1;\\n\\t}\\n\\n\\treturn {\\n\\t\\t\\"alarmType\\": fx_alarmType,\\n\\t\\t\\"alarmStatus\\": fx_alarmStatus,\\n\\t\\t\\"alarmValue\\": fx_alarmStatus\\n\\t};\\n}\\n\\n/**\\n * 门磁\\n * @param sw\\n */\\nfunction menci(sw) {\\n\\tvar men_alarmType = \'闭合\';\\n\\tvar men_alarmStatus = 2;\\n\\tif (sw == \'1\') {\\n\\t\\tmen_alarmType = \'打开\';\\n\\t\\tmen_alarmStatus = 1;\\n\\t}\\n\\treturn {\\n\\t\\t\\"alarmType\\": men_alarmType,\\n\\t\\t\\"alarmStatus\\": men_alarmStatus,\\n\\t\\t\\"alarmValue\\": men_alarmStatus\\n\\t};\\n}", "main": "decode"}, "encode": {"code": "function encode(param)\\r\\n{\\r\\n return \\"\\";\\r\\n}", "main": "encode"}}', 'report', 'status', 1, 2000, 1699710383579, 1702621432301),
