	(1073, 'splitHandler', 'JB-QB-GST500', '海湾安全技术有限公司', 'JavaScript', 'channel', '{"decode": {"code": "/**\\n* 编码器的入口函数\\n* 全局参数：\\n*     message：hex string格式的接收数据\\n*              XX+[合法报文]+XXX，合法报文可能混杂在一堆其他数据之中\\n* 返回值：\\n*   从XXX+[合法报文]+XXX中，截取到的[合法报文]\\n*/\\nfunction decode(message) {\\n  // 测试脚本：JB-QB-GST500报文的特点，是一行一行的文本流\\n\\t//var message = \'4D4D\';\\n\\t//message = message + \'2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 0D \';\\n\\t//message = message + \'0A 32 30 32 33 C4 EA 31 31 D4 C2 32 36 C8 D5 20 31 36 CA B1 34 36 B7 D6 0D \';\\n\\t//message = message + \'0D\';\\n\\t//message = message + \'31 2F 35 20 0D\';\\n\\t//message = message + \'CF FB BB F0 CB A8 B0 B4 C5 A5 B1 A8 BB F0 BE AF 0D\';\\n\\t//message = message + \'EE EE\';\\n\\t//message = message.replace(/\\\\s+/g, \\"\\");\\n  \\n\\tvar starTag = \\"2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D\\";\\n\\tvar endTag = \\"0D\\";\\n\\n\\t// 转换成大写\\n\\tmessage = message.toUpperCase();\\n\\n\\t// 寻找起始标记\\n\\tvar start = message.indexOf(starTag);\\n\\tif (start < 0) {\\n\\t\\treturn \\"\\";\\n\\t}\\n\\n\\tvar data = message.substring(start);\\n\\n\\t// 寻找结束符\\n\\tmessage = data;\\n\\tvar end = 0;\\n\\n\\t// 连续5行数据  \\n\\tfor (var i = 0; i < 5; i++) {\\n\\t\\tend = data.indexOf(endTag, end + endTag.length);\\n\\t\\tif (end < 0) {\\n\\t\\t\\treturn \\"\\";\\n\\t\\t}\\n\\n\\t}\\n\\n  // 截取数据\\n\\tvar result = data.substring(0, end + endTag.length);\\n\\n\\treturn result;\\n}\\n", "main": "decode"}, "description": "报文格式：\\n以2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D开始，以0D字符结束的多行文本\\n每一行文本，都以0D作为换行符\\n--------------------------------------------------------------------------------------------------------------------------\\n\\n测试报文1：\\n2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 0D 0A 32 30 32 33 C4 EA 31 31 D4 C2 32 36 C8 D5 20 31 36 CA B1 34 36 B7 D6 0D 0D 31 2F 35 20 0D CF FB BB F0 CB A8 B0 B4 C5 A5 B1 A8 BB F0 BE AF 0D\\n\\n报文内容：\\n2023年11月26日 16时46分\\n\\n1/5 \\n消火栓按钮报火警\\n\\n--------------------------------------------------------------------------------------------------------------------------"}', 'splitHandler', 'status', 1, 2000, 1701916152224, 1703252376429),
	(1075, 'keyHandler', 'JB-QB-GST500', '海湾安全技术有限公司', 'JavaScript', 'channel', '{"decode": {"code": "/**\\n* 编码器的入口函数\\n* 全局参数：\\n*     fox_edge_data：hex string格式的接收数据\\n*                    XXX+[合法报文]+XXX，合法报文可能混杂在一堆其他数据之中\\n*     fox_edge_param：json string格式的设备参数的合并对象\\n* 返回值：\\n*   从XXX+[合法报文]+XXX中，截取到的[合法报文]\\n*/\\nfunction decode(message) {\\n\\t// 测试脚本 \\n\\t//var message = \'4D4D\';\\n\\t//message = message + \'2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 2D 0D \';\\n\\t//message = message + \'0A 32 30 32 33 C4 EA 31 31 D4 C2 32 36 C8 D5 20 31 36 CA B1 34 36 B7 D6 0D \';\\n\\t//message = message + \'0D\';\\n\\t//message = message + \'31 2F 35 20 0D\';\\n\\t//message = message + \'CF FB BB F0 CB A8 B0 B4 C5 A5 B1 A8 BB F0 BE AF 0D\';\\n\\t//message = message + \'EE EE\';\\n\\t//message = message.replace(/\\\\s+/g, \\"\\");\\n\\tvar starTag = \\"2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D2D\\";\\n\\tvar endTag = \\"0D\\";\\n\\n\\t// 转换成大写\\n\\tmessage = message.toUpperCase();\\n\\n\\t// 寻找起始标记\\n\\tvar start = message.indexOf(starTag);\\n\\tif (start < 0) {\\n\\t\\treturn \\"\\";\\n\\t}\\n\\n\\tvar data = message.substring(start);\\n\\n\\t// 寻找结束符\\n\\tmessage = data;\\n\\tvar end = 0;\\n\\tstart = 0;\\n\\n\\t// 连续4行数据  \\n\\tvar result = \\"\\";\\n\\tfor (var i = 0; i < 4; i++) {\\n\\t\\tend = data.indexOf(endTag, end + endTag.length);\\n\\t\\tif (end < 0) {\\n\\t\\t\\treturn \\"\\";\\n\\t\\t}\\n\\n\\t\\tresult = data.substring(start, end + endTag.length);\\n\\t\\tstart = end + endTag.length;\\n\\n\\t}\\n\\n\\tresult = result.substring(0, result.length - endTag.length);\\n\\n\\t// 转成文本\\n\\tresult = hexToString(result);\\n\\n\\t// 去掉空格\\n\\tresult = result.replace(\\" \\", \\"\\");\\n\\n\\treturn result;\\n}\\n\\n/**\\n* 转换成文本\\n*/\\nfunction hexToString(hex) {\\n\\tvar result = \'\';\\n\\tfor (var i = 0; i < hex.length; i += 2) {\\n\\t\\tvar charCode = parseInt(hex.substr(i, 2), 16);\\n\\t\\tresult += String.fromCharCode(charCode);\\n\\t}\\n\\t