	(1076, '消火栓按钮报火警', 'JB-QB-GST500', '海湾安全技术有限公司', 'JavaScript', 'device', '{"decode": {"code": "/**\\n * 解码器的入口函数\\n * 全局参数：\\n *     fox_edge_data：json string格式 或者 hex string格式的接收数据\\n *     fox_edge_param：json string格式的设备参数的合并对象\\n * 返回值：\\n *   提供给通道的发送数据。根据不同的通道服务，它可能是HEX结构的文本，也可能是JSON结构的对象，请自行根据选定的通道服务进行确认\\n */\\nfunction decode() {\\n\\tvar object = decodeStr(fox_edge_data, fox_edge_param);\\n  return JSON.stringify(object);\\n}\\n\\n/**\\n* 事件解码器函数：消火栓按钮报火警\\n* 全局参数：\\n*     fox_edge_data：hex string格式的接收数据\\n*                    XXX+[合法报文]+XXX，合法报文可能混杂在一堆其他数据之中\\n*     fox_edge_param：json string格式的设备参数的合并对象\\n* 返回值：\\n*   必须是列表格式的JSON字符串，并且JSON对象必须包含关键字【recordType】，否则不给与入库\\n*/\\nfunction decodeStr(message, device_param) {\\n\\t//var message = \\"----------------------\\\\r\\\\n2023年11月26日 16时46分\\\\r\\\\n\\\\r\\\\n1/5 \\\\r\\\\n消火栓按钮报火警\\\\r\\\\n\\";\\n\\tvar datas = message.split(\'\\\\r\');\\n\\tvar head = datas[0];\\n\\tvar datetime = datas[1];\\n\\tvar node = datas[3];\\n\\tvar event = datas[4];\\n\\n  datetime = datetime.replace(\\"\\\\r\\", \\"\\");\\n  datetime = datetime.replace(\\"\\\\n\\", \\"\\");\\n  \\n\\tnode = node.replace(\\" \\", \\"\\");\\n\\n  // 必须包含recordType字段，用来指明事件的类型\\n\\tvar obj = {\\n    \\"recordType\\": event,\\n\\t\\t\\"datetime\\": datetime,\\t\\t\\n\\t\\t\\"node\\": node\\n\\t};\\n\\n  // 必须以列表格式返回\\n\\tvar result = new Array();\\n\\tresult.push(obj);\\n\\n\\treturn result;\\n}", "main": "decode"}}', 'report', 'record', 1, 2000, 1701943612264, 1701960822060),
