	(1080, '范例2：读取当前工作电流', '基站电源-ABC', '华为技术有限公司', 'JavaScript', 'device', '{"encode": {"code": "/**\\n* 编码器的入口函数\\n* 全局参数：\\n*     fox_edge_param：json string格式的设备参数的合并对象\\n* 返回值：\\n*   提供给通道的发送数据。根据不同的通道服务，它可能是HEX结构的文本，也可能是JSON结构的对象，请自行根据选定的通道服务进行确认\\n*/\\nfunction encode() {\\n\\treturn encodeHex(fox_edge_param);\\n}\\n\\n/**\\n* 开发者自己写的编码函数1\\n* 返回格式1：HEX格式的字符串\\n*     比如串口通道，TCP通道、模拟通道，它们的输入/输出格式，就是HEX格式的文本\\n*/\\nfunction encodeHex(param) {\\n\\treturn \\"46 49 4E 53 00 00 00 1A 00 00 00 02 00 00 00 00 80 00 02 00 0A 00 00 71 00 FF 01 01 B1 00 0A 00 00 01\\";\\n}\\n\\n/**\\n* 开发者自己写的编码函数2\\n* 返回格式2：JSON格式的字符串\\n*     比如S7通道、MQTT通道，它们的输入/输出格式，就是JSON格式的文本\\n*/\\nfunction encodeJson(param) {\\n  var object = JSON.parse(param);\\n\\treturn JSON.stringify(object);\\n}", "main": "encode"}}', 'publish', 'status', 1, 2001, 1702646396415, 1702646396415),
	(1081, '范例1：读取当前工作电压', '基站电源-ABC', '华为技术有限公司', 'JavaScript', 'device', '{"decode": {"code": "/**\\n* 编码器的入口函数\\n* 全局参数：\\n*     fox_edge_data：json string格式 或者 hex string格式的接收数据\\n*     fox_edge_param：json string格式的设备参数的合并对象\\n* 返回值：\\n*   提供给通道的发送数据。根据不同的通道服务，它可能是HEX结构的文本，也可能是JSON结构的对象，请自行根据选定的通道服务进行确认\\n*/\\nfunction decode() {\\n   return decodeJson(fox_edge_data, fox_edge_param);\\n}\\n\\n/**\\n* 开发者自己写的解码函数1\\n* 返回格式：JSON格式的字符串\\n*/\\nfunction decodeJson(recv, param) {\\n  var object = JSON.parse(param);\\n\\treturn JSON.stringify(object);\\n}", "main": "decode"}, "encode": {"code": "/**\\n* 编码器的入口函数\\n* 全局参数：\\n*     fox_edge_param：json string格式的设备参数的合并对象\\n* 返回值：\\n*   提供给通道的发送数据。根据不同的通道服务，它可能是HEX结构的文本，也可能是JSON结构的对象，请自行根据选定的通道服务进行确认\\n*/\\nfunction encode() {\\n\\treturn encodeHex(fox_edge_param);\\n}\\n\\n/**\\n* 开发者自己写的编码函数1\\n* 返回格式1：HEX格式的字符串\\n*     比如串口通道，TCP通道、模拟通道，它们的输入/输出格式，就是HEX格式的文本\\n*/\\nfunction encodeHex(param) {\\n\\treturn \\"46 49 4E 53 00 00 00 1A 00 00 00 02 00 00 00 00 80 00 02 00 0A 00 00 71 00 FF 01 01 B1 00 0A 00 00 01\\";\\n}\\n\\n/**\\n* 开发者自己写的编码函数2\\n* 返回格式2：JSON格式的字符串\\n*     比如S7通道、MQTT通道，它们的输入/输出格式，就是JSON格式的文本\\n*/\\nfunction encodeJson(param) {\\n  var object = JSON.parse(param);\\n\\treturn JSON.stringify(object);\\n}", "main": "encode"}}', 'exchange', 'status', 1, 2000, 1702646396454, 1702646396454),
