	(1087, 'splitHandler', 'JB-QB-GST9000', '海湾安全技术有限公司', 'JavaScript', 'channel', '{"decode": {"code": "/**\\n* 编码器的入口函数\\n* 全局参数：\\n*     message：hex string格式的接收数据 \\n*              XX+[合法报文]+XXX，合法报文可能混杂在一堆其他数据之中\\n* 返回值：\\n*   从XXX+[合法报文]+XXX中，截取到的[合法报文]\\n*/\\nfunction decode(message) {\\n\\t// 测试脚本：JB-QB-GST9000报文的特点，是一行一行的文本流\\n\\t//\\tvar message = \'\';\\n\\t//\\tmessage = message + \'00 1B 36 30 38 2F 31 32 2F 30 32 20 20 31 37 3A 32 34 0A 20 20 30 30 34  2D 30 30 34 0A1B 39 CA D7 B4 CE BB F0 BE AF  0AC8 B9 C2A5 D2 BB B2 E3 C9 CF BF D5 0AB8 D0D1CCCC BD B2 E2 C6 F7 0A0A 11\';\\n\\t//\\tmessage = message.replace(/\\\\s+/g, \\"\\");\\n\\tvar starTag = \\"1B\\";\\n\\tvar endTag = \\"0A0A\\";\\n\\n\\t// 转换成大写\\n\\tmessage = message.toUpperCase();\\n\\n\\t// 寻找起始标记\\n\\tvar start = message.indexOf(starTag);\\n\\tif (start < 0) {\\n\\t\\treturn \\"\\";\\n\\t}\\n  message = message.substring(start, message.length);\\n  \\n\\t// 寻找结束符\\n\\tvar end = message.indexOf(endTag);\\n\\tif (end < 0) {\\n\\t\\treturn \\"\\";\\n\\t}\\n\\n\\tvar data = message.substring(0, end + endTag.length);\\n\\n\\t// 寻找结束符\\n\\tmessage = data;\\n\\tend = 0;\\n\\n\\t// 检测：是否至少连续4个0A\\n\\tendTag = \\"0A\\";\\n\\tfor (var i = 0; i < 4; i++) {\\n\\t\\tend = data.indexOf(endTag, end + endTag.length);\\n\\t\\tif (end < 0) {\\n\\t\\t\\treturn \\"\\";\\n\\t\\t}\\n\\n\\t}\\n\\n\\t// 截取数据\\n\\tvar result = data;\\n\\n\\treturn result;\\n}", "main": "decode"}, "description": "文档：\\nhttps://abg.baidu.com/view/70f35e04cc17552707220808?fr=search-income-top3page\\n--------------------------------------------------------------------------------------------------------------------------\\n报文格式：\\n是以1B开头，0A0A结尾的一段GB2312文本，每一行文本，以0A为换行符\\n形成了多行的字符串文本\\n\\n--------------------------------------------------------------------------------------------------------------------------\\n\\n测试报文1：\\n1B 36 30 38 2F 31 32 2F 30 32 20 20 31 37 3A 32 34 0A 20 20 30 30 34  2D 30 30 34 0A  1B 39 CAD7 B4 CE BB F0 BE AF  0AC8 B9 C2A5 D2 BB B2 E3 C9 CF BF D5 0AB8 D0D1CCCC BD B2 E2 C6 F7 0A0A\\n\\n上报报文:\\u001b608/12/02  17:24\\n  004-004\\n\\u001b9首次火警\\n裙楼一层上空\\n感烟探测器\\n\\n--------------------------------------------------------------------------------------------------------------------------\\n测试报文2：\\n1B 36  30 38 2F 31 32 2F 30 32 20 20 31 37 3A 32 31 0A 20 20 30 30 36  2D 30 30 37  0A 1B 39 BB F0 BE AF  BA F3 D0 F8 0A D6 D0D1 CC C1F9 B2E3 BC C6 BB AE B2 BF 0A B8 D0D1 CC CC BD B2E2 C6 F7 0A0A\\n\\n上报报文:\\u001b608/12/02  17:21\\n  006-007\\n\\u001b9火警后续\\n中烟六层计划部\\n感烟探测器\\n--------------------------------------------------------------------------------------------------------------------------\\n测试报文3：\\n1B 36 30 38 2F 31 32 2F 30 32 20 20 31 37 3A 32 35 0A 20 20 0A 1B 39 CF B5 CD B3 B8 B4 CE BB 0A 0A\\n\\n上报报文:\\u001b608/12/02  17:25\\n  \\n\\u001b9系统复位\\n\\n\\n"}', 'splitHandler', 'status', 1, 2000, 1703166735892, 1703252225932),
	(1088, 'keyHandler', 'JB-QB-GST9000', '海湾安全技术有限公司', 'JavaScript', 'channel', '{"decode": {"code": "/**\\n* 编码器的入口函数\\n* 全局参数：\\n*     fox_edge_data：hex string格式的接收数据\\n*                    XXX+[合法报文]+XXX，合法报文可能混杂在一堆其他数据之中\\n*     fox_edge_param：json string格式的设备参数的合并对象\\n* 返回值：\\n*   从XXX+[合法报文]+XXX中，截取到的[合法报文]\\n*/\\nfunction decode(message) {\\n\\t// 测试脚本：JB-QB-GST9000报文的特点，是一行一行的文本流\\n\\t//\\tvar message = \'\';\\n\\t//\\tmessage = message + \'00 1B 36 30 38 2F 31 32 2F 30 32 20 20 31 37 3A 32 34 0A 20 20 30 30 34  2D 30 30 34 0A1B 39 CA D7 B4 CE BB F0 BE AF  0AC8 B9 C2A5 D2 BB B2 E3 C9 CF BF D5 0AB8 D0D1CCCC BD B2 E2 C6 F7 0A0A 11\';\\n\\t//\\tmessage = message.replace(/\\\\s+/g, \\"\\");\\n\\tvar starTag = \\"1B\\";\\n\\tvar endTag = \\"0A0A\\";\\n\\n\\t// 转换成大写\\n\\tmessage = message.toUpperCase();\\n\\n\\t// 寻找起始标记\\n\\tvar start = message.indexOf(starTag);\\n\\tif (start < 0) {\\n\\t\\treturn \\"\\";\\n\\t}\\n\\t// 寻找结束符\\n\\tvar end = message.indexOf(endTag);\\n\\tif (end < 0) {\\n\\t\\treturn \\"\\";\\n\\t}\\n\\n\\tvar data = message.substring(start, end + endTag.length);\\n\\n\\t// 寻找结束符\\n\\tmessage = data;\\n\\tend = 0;\\n\\n\\t// 连续2行数据  \\n  endTag = \\"0A\\";\\n\\tvar result = \\"\\";\\n\\tfor (var i = 0; i < 2; i++) {\\n\\t\\tend = data.indexOf(endTag, end + endTag.length);\\n\\t\\tif (end < 0) {\\n\\t\\t\\treturn \\"\\";\\n\\t\\t}\\n\\n\\t\\tresult = data.substring(start, end + endTag.length);\\n\\t\\tstart = end + endTag.length;\\n\\n\\t}\\n\\n\\tresult = result.substring(0, result.length - endTag.length);\\n\\n\\t// 转成文本\\n\\tresult = hexToString(result);\\n\\n\\t// 去掉多个空格\\n\\tfor (var i = 0; i < 5; i++) {\\n\\t\\tresult = result.replace(\\" \\", \\"\\");\\n\\t}\\n\\n\\treturn result;\\n}\\n\\n/**\\n* 转换成文本\\n*/\\nfunction hexToString(hex) {\\n\\tvar result = \'\';\\n\\tfor (var i = 0; i < hex.length; i += 2) {\\n\\t\\tvar charCode = parseInt(hex.substr(i, 2), 16);\\n\\t\\tresult += String.fromCharCode(charCode);\\n\\t}\\n\\treturn result;\\n}", "main": "decode"}}', 'keyHandler', 'status', 1, 2000, 1703171171879, 1703172576541),
	(1090, '消火栓按钮报火警', 'JB-QB-GST9000', '海湾安全技术有限公司', 'JavaScript', 'device', '{"decode": {"code": "/**\\n * 解码器的入口函数\\n * 全局参数：\\n *     fox_edge_data：json string格式 或者 hex string格式的接收数据\\n *     fox_edge_param：json string格式的设备参数的合并对象\\n * 返回值：\\n *   提供给通道的发送数据。根据不同的通道服务，它可能是HEX结构的文本，也可能是JSON结构的对象，请自行根据选定的通道服务进行确认\\n */\\nfunction decode() {\\n\\tvar object = decodeStr(fox_edge_data, fox_edge_param);\\n  return JSON.stringify(object);\\n}\\n\\n/**\\n* 事件解码器函数：消火栓按钮报火警\\n* 全局参数：\\n*     fox_edge_data：hex string格式的接收数据\\n*                    XXX+[合法报文]+XXX，合法报文可能混杂在一堆其他数据之中\\n*     fox_edge_param：json string格式的设备参数的合并对象\\n* 返回值：\\n*   必须是列表格式的JSON字符串，并且JSON对象必须包含关键字【recordType】，否则不给与入库\\n*/\\nfunction decodeStr(message, device_param) {\\n\\t\\t//var message = \\"\\u001b608/12/02  17:24\\\\n  004-004\\\\n\\u001b9首次火警\\\\n裙楼一层上空\\\\n感烟探测器\\";\\n\\t// 以\'\\\\u001b\'开始\\n\\tif (message.indexOf(\'\\\\u001b\') != 0) {\\n\\t\\treturn \\"error 1\\";\\n\\t}\\n\\n\\t// 以\'\\\\u000a\'为换行符\\n\\tvar datas = message.split(\'\\\\u000a\');\\n\\tif (datas.length < 5 || datas.length > 7) {\\n\\t\\treturn \\"error 2\\";\\n\\t}\\n\\n\\t// 5行数据\\n\\tvar datetime = datas[0];\\n\\tvar node = datas[1];\\n\\tvar event = datas[2];\\n\\tvar position = datas[3];\\n\\tvar source = datas[4];\\n\\n\\t// 日期：去掉\'\\\\u001b\'字符，去掉第一个不知道是啥含义的数字，就是日期\\n\\tif (datetime.indexOf(\'\\\\u001b\') != 0) {\\n\\t\\treturn \\"error 3\\";\\n\\t}\\n\\tdatetime = datetime.replace(\'\\\\u001b\', \\"\\");\\n\\tdatetime = datetime.substring(1, datetime.length);\\n\\n\\t// 事件：去掉\'\\\\u001b\'字符，去掉第一个不知道是啥含义的数字，就是事件\\n\\tif (event.indexOf(\'\\\\u001b\') != 0) {\\n\\t\\treturn \\"error 4\\";\\n\\t}\\n\\tevent = event.replace(\'\\\\u001b\', \\"\\");\\n\\tevent = event.substring(1, event.length);\\n\\n\\t// 清空空格\\n\\tfor (var i = 0; i < 5; i++) {\\n\\t\\tnode = node.replace(\\" \\", \\"\\");\\n\\t}\\n\\n\\t// 必须包含recordType字段，用来指明事件的类型\\n\\tvar obj = {\\n\\t\\t\\"recordType\\": event,\\n\\t\\t\\"datetime\\": datetime,\\n\\t\\t\\"node\\": node,\\n\\t\\t\\"position\\": position,\\n\\t\\t\\"source\\": source\\n\\t};\\n\\n\\t// 必须以列表格式返回\\n\\tvar result = new Array();\\n\\tresult.push(obj);\\n\\n\\treturn result;\\n}", "main": "decode"}, "description": "文档：\\nhttps://abg.baidu.com/view/70f35e04cc17552707220808?fr=search-income-top3page\\n--------------------------------------------------------------------------------------------------------------------------\\n报文格式：\\n是以1B开头，0A0A结尾的一段GB2312文本，每一行文本，以0A为换行符\\n形成了多行的字符串文本\\n\\n--------------------------------------------------------------------------------------------------------------------------\\n\\n测试报文1：\\n1B 36 30 38 2F 31 32 2F 30 32 20 20 31 37 3A 32 34 0A 20 20 30 30 34  2D 30 30 34 0A  1B 39 CAD7 B4 CE BB F0 BE AF  0AC8 B9 C2A5 D2 BB B2 E3 C9 CF BF D5 0AB8 D0D1CCCC BD B2 E2 C6 F7 0A0A\\n\\n上报报文:\\u001b608/12/02  17:24\\n  004-004\\n\\u001b9首次火警\\n裙楼一层上空\\n感烟探测器\\n\\n--------------------------------------------------------------------------------------------------------------------------\\n测试报文2：\\n1B 36  30 38 2F 31 32 2F 30 32 20 20 31 37 3A 32 31 0A 20 20 30 30 36  2D 30 30 37  0A 1B 39 BB F0 BE AF  BA F3 D0 F8 0A D6 D0D1 CC C1F9 B2E3 BC C6 BB AE B2 BF 0A B8 D0D1 CC CC BD B2E2 C6 F7 0A0A\\n\\n上报报文:\\u001b608/12/02  17:21\\n  006-007\\n\\u001b9火警后续\\n中烟六层计划部\\n感烟探测器\\n--------------------------------------------------------------------------------------------------------------------------\\n测试报文3：\\n1B 36 30 38 2F 31 32 2F 30 32 20 20 31 37 3A 32 35 0A 20 20 0A 1B 39 CF B5 CD B3 B8 B4 CE BB 0A 0A\\n\\n上报报文:\\u001b608/12/02  17:25\\n  \\n\\u001b9系统复位\\n\\n\\n"}', 'report', 'record', 1, 2000, 1703172666459, 1703252214463);
